import React, { Component } from 'react';
import Cart from './cart/cart';
import Search from './search/Search';

class Middle_nav extends Component {
    render() {
        return (
            <div>
                <div className="mid-header container-fluid ">
                <nav className="navbar navbar-expand-lg navbar-light ">
                    <div className="container">
                    <div className="col-xs-12 col-sm-2 col-md-2 col-lg-2 d-flex">
                        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon" />
                        </button>
                        <a className="navbar-brand" href="#"><img src="../img/logo.jpg" alt="Logo BookStore" className="img-fluid" /></a>
                    </div>
                    <Search />
                    <Cart />
                    </div>
                </nav>
                </div>
            </div>
        );
    }
}

export default Middle_nav;
